import React, { Suspense, lazy } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './components/AuthContext/AuthContext';
import { CartProvider } from './components/CartContext/CartContext';
import UserProfile from './components/UserProfile/UserProfile';
import FloatingIcons from "./components/NavEl/TG/FloatingIcons";
import AdminPanel from './components/UserProfile/AdminPanel';

const Header = lazy(() => import('./components/Header/Header'));
const SliderComponent = lazy(() => import('./components/SliderComponent/SliderComponent'));
const IntroSection = lazy(() => import('./components/IntroSection/IntroSection'));
const Catalog = lazy(() => import('./components/Catalog/Catalog'));
const Footer = lazy(() => import('./components/Footer/Footer'));
const Cart = lazy(() => import('./components/Cart/Cart'));
const Adventage = lazy(() => import('./components/Adventage/Adventage'));
const NotFoundPage = lazy(() => import('./components/NotFoundPage/NotFoundpage'));
const FurnitureConstructor = lazy(() => import('./components/NavEl/Constructor/FurnitureConstructor')); // Новый импорт

const LoadingIndicator = () => (
  <div className="loading-indicator">
    <div className="spinner-border text-primary" role="status">
      <span className="sr-only">Загрузка...</span>
    </div>
  </div>
);

const IndexPage = () => (
  <>
    <SliderComponent />
    <Catalog />
    <Adventage/>
  </>
);

function App() {
  return (
    <Router>
      <AuthProvider>
        <CartProvider>
          <div className="App">
            <Suspense fallback={<LoadingIndicator />}>
              <Header />
              <div className="content-wrapper">
                <main>
                  <Routes>
                    <Route path="/about" element={<IntroSection />} />
                    <Route path="/catalog" element={<Catalog />} />
                    <Route path="/cart" element={<Cart />} />
                    <Route path="/profile" element={<UserProfile />} />
                    <Route path="/admin" element={<AdminPanel />} />
                    <Route path="/constructor" element={<FurnitureConstructor />} /> {/* Новый маршрут */}
                    <Route path="/" element={<IndexPage />} />
                    <Route path="*" element={<NotFoundPage />} />
                  </Routes>
                </main>
                <FloatingIcons />
              </div>
              <Footer />
            </Suspense>
          </div>
        </CartProvider>
      </AuthProvider>
    </Router>
  );
}

export default App;
